import logo from './logo.svg';
import './App.css';
import Login from './Login'
import Core from './Core';

class App extends React.Component {
  state = {
    isAuthenticated: false,
    token: null,
  }
  render(){
    if (!this.state.isAuthenticated){
      return(
        <Login />
      )
    }
    else {
      return (
        <Core />
      );
    }
  }


}

export default App;
